import React from 'react';
import Logo from '../data/logo.png';


const SimplePage = () => {
  return (
    <section className='bg-black-100  p-10'>
      <div className='container border border-black mx-auto flex'>
        <img src={Logo} alt='logo' />
        <ul className="flex ml-auto">
        <li className="text-black "><a href='HO'/></li>
        <li className="text-black"></li>
        <li className="text-black"></li>
        <li className="text-black"></li>
        <li className="text-black"></li>
      </ul>
      </div>
    </section>
  );
};

export default SimplePage;
